import { useEffect, useState } from "react";

function App() {
  const [data, setData] = useState();
  useEffect(() => {
    fetch("./Rule JSON.json")
      .then((response) => response.json())
      .then((item) => setData(item.data));
  }, []);

  console.log(data);

  return { data };
}

export default App;

